#My first attempt at this was to use Ford-Fulkerson, which only swallowed time and i found myself wrestling with it to run faster
#Instead I switched to a push-relabel implementation which took a fraction of the time to write. Not only that,
#it's much much faster.
#After all, our first priority is getting those bunnies to safety as quick as we can

maxEdgeCap = 50 * 2000000

def answer(sources, sinks, residual):
	n = len(residual)

	for i in range(n):
		residual[i][i] = 0

	#Consolidate sources and sinks to one vertex each
	source = n
	sink = n + 1
	n += 2
	for v in residual:
		v += [0, 0]
	residual += [[0] * (n) for i in xrange(2)]

	for v in sources:
		residual[source][v] = maxEdgeCap
	for v in sinks:
		residual[v][sink] = maxEdgeCap

	height = [0] * n
	excess = [0] * n
	height[source] = n


	def push(v, w, flow):
		residual[w][v] += flow
		residual[v][w] -= flow
		excess[v] -= flow
		excess[w] += flow

	def getHighestVertex():
		vertexAndHeight = (-1, -1)
		for v in xrange(n-2):
			if excess[v] > 0 and height[v] > vertexAndHeight[1]:
				vertexAndHeight = v, height[v]
		return vertexAndHeight[0]

	def getValidEdgeOf(v):
		for w, cap in enumerate(residual[v]):
			if cap > 0 and height[v] - 1 == height[w]:
				return w, cap
		return (-1, -1)

	#Preflow, fill all edges connected to source to their capacity
	for w, cap in enumerate(residual[source]):
		push(source, w, cap)

	v = getHighestVertex()

	#Push-relabel until all vertices have 0 excess (except the sink)
	#The highest vertex with excess is stored in v to reduce the amount of calls
	#to getHighestVertex() by about O(n^2) (roughly the amount of saturating pushes)
	while True:
		if v == -1:
			break
		w, edgeCap = getValidEdgeOf(v)

		if w == -1:
			height[v] += 1
		else:
			push(v, w, min(excess[v], edgeCap))
			if excess[v] == 0:
				v = getHighestVertex()
	return excess[sink]


